const SandboxCollection = require('./SandboxCollection');

class SandboxLanes extends SandboxCollection {
    _get(key) {
        if (Object.prototype.hasOwnProperty.call(this.extraArray, key)) {
            return this.extraArray[key];
        }
        else if (!Object.prototype.hasOwnProperty.call(this.originalArray, key)) {
            return undefined;
        }
        else {
            this.extraArray[key] = [];
            for (let i = 0; i < this.originalArray[key].length; i++) {
                this.extraArray[key].push({
                    id: this.originalArray[key][i].id,
                    // incident: this.originalArray[key][i].incident,
                    millisecond: this.originalArray[key][i].millisecond * 1
                });
            }
            return this.extraArray[key];
        }
    }
}

module.exports = SandboxLanes;
